import React, { Component } from 'react'
import io from 'socket.io-client'

const socket = io.connect('http://localhost:4000')

export default class Layout extends Component {
    render() {
        const { title } = this.props
        return (
            <div className="container">
                {title}
            </div>
        )
    }
}
